package com.example.schooladmin.model;public class Student {    private int id;    private String name;    private String phone;    private String password;    private int classID;    private String className;    public Student(int id, String name, String phone, String className) {        this.id = id;        this.name = name;        this.phone = phone;        this.className = className;    }    public Student(int id, String name, String phone, String password, int classID) {        this.id = id;        this.name = name;        this.phone = phone;        this.password = password;        this.classID = classID;    }    public String getPassword() {        return password;    }    public void setPassword(String password) {        this.password = password;    }    public int getClassID() {        return classID;    }    public void setClassID(int classID) {        this.classID = classID;    }    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getPhone() {        return phone;    }    public void setPhone(String phone) {        this.phone = phone;    }    public String getClassName() {        return className;    }    public void setClassName(String className) {        this.className = className;    }}